Settings_Vtiger_Edit_Js("Settings_Groups_Edit_Js",{},{memberSelectElement:false,getMemberSelectElement:function(){if(this.memberSelectElement==false){this.memberSelectElement=jQuery("#memberList")}return this.memberSelectElement},registerFormForValidation:function(){var editViewForm=this.getForm();editViewForm.validationEngine(app.getvalidationEngineOptions(true))},registerSubmitEvent:function(){var thisInstance=this;var form=jQuery("#EditView");form.on("submit",function(e){if(form.data("submit")=="true"&&form.data("performCheck")=="true"){return true}else{if(form.data("jqv").InvalidFields.length<=0){var formData=form.serializeFormData();thisInstance.checkDuplicateName({groupname:formData.groupname,record:formData.record}).done(function(data){form.data("submit","true");form.data("performCheck","true");form.submit()}).fail(function(data,err){var params={};params["text"]=data["message"];params["type"]="error";Settings_Vtiger_Index_Js.showMessage(params);return false})}else{form.removeData("submit");app.formAlignmentAfterValidation(form)}e.preventDefault()}})},checkDuplicateName:function(details){var aDeferred=jQuery.Deferred();var params={module:app.getModuleName(),parent:app.getParentModuleName(),action:"EditAjax",mode:"checkDuplicate",groupname:details.groupname,record:details.record};AppConnector.request(params).done(function(data){var response=data["result"];var result=response["success"];if(result==true){aDeferred.reject(response)}else{aDeferred.resolve(response)}}).fail(function(error,err){aDeferred.reject(error,err)});return aDeferred.promise()},registerEvents:function(){this._super();this.registerSubmitEvent()}});